let app=new Vue({el:"#vue-header",data:{currentTheme:"",themes:[]},created:function(){fetch("/Api/Theme").then(e=>e.json()).then(e=>{this.themes=e});var e=localStorage.getItem("currentTheme");null!=e&&(this.currentTheme=e)},methods:{setTheme(t){var e=this.themes.find(e=>e.name===t);loadStyles(e.cssUrl),this.currentTheme=t,localStorage.setItem("currentTheme",t),localStorage.setItem("currentThemeCssUrl",e.cssUrl)}}});